import React,{useState} from 'react';
import logo from './logo.svg';
import './App.css';
import axios from 'axios'

const [data,setData]=useState()
axios.get('http://localhost:5000')
.then(res => {
  const sqldata = res.data
  setData(sqldata)
})

function App() {
  return (
    <div className="App">
      {data}
    </div>
  );
}

export default App;
